/*
* 423. 从英文中重建数字
给定一个非空字符串，其中包含字母顺序打乱的英文单词表示的数字0-9。按升序输出原始的数字。

注意:

输入只包含小写英文字母。
输入保证合法并可以转换为原始的数字，这意味着像 "abc" 或 "zerone" 的输入是不允许的。
输入字符串的长度小于 50,000。
示例 1:

输入: "owoztneoer"

输出: "012" (zeroonetwo)
示例 2:

输入: "fviefuro"

输出: "45" (fourfive)
  */
class Solution {

    /**
     * @param String $s
     * @return String
     */
    function originalDigits($s) {
        Hash_char = {'z':'0', 'o':'1', 'w':'2', 'r':'3', 'u':'4',
        'f':'5', 'x':'6', 's':'7', 'g':'8', 'i':'9'}
        Hash_num = {'z':'', 'o':'', 'w':'', 'r':'', 'u':'', 'f':'', 'x':'', 's':'',
        'g':'', 'i':''}
        words = []
        for x in ['zero','two','four','six','eight','one','three','five','seven','nine']:
            words.append(list(x))
        Hash_s = {}
        for i in s:
            Hash_s[i] = Hash_s.get(i, 0) + 1
        char = ['z', 'w', 'u', 'x', 'g', 'o', 'r', 'f', 's', 'i']
        for j in range(len(char)):
            if Hash_s.get(char[j]) is not None:
                if Hash_s[char[j]] > 0:
                    count = Hash_s[char[j]]
                    word = words[j]
                    Hash_num[char[j]] += Hash_char[char[j]]*count
                    for k in word:
                        Hash_s[k] -= count
        res = ''
        for value in Hash_num.values():
            res += value
        return res

